script: |
  super -f text -I q3454.spq | sort > q3454.out

inputs:
  - name: q3454.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT col1 BETWEEN + + CAST ( + + col0 AS INTEGER ) + 87 AND - col0 / col0 * + 99 + + col0 + - col0 - + + col2 * + col2 * col1;
  - name: tab1

outputs:
  - name: q3454.out
    data: |
      51	14	96
      85	5	59
      91	47	68
